  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitat polygon coverages are being
  created for the Olympic Coast National Marine Sanctuary (OCNMS). OCNMS has collected
  side scan sonar, multibeam backscatter, multibeam bathymetry, bottom grab and video
  data to produce polygon coverages describing seafloor substrate for various areas
  within the sanctuary. The habitat polygons have attributes for megahabitat, bottom
  induration, mesohabitat, macrohabitat, polygon area and perimeter.\",\n\t\"owner_org\":
